// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TrialManager {
    address public admin;
    mapping(address => uint256) public trialEnds;

    event TrialSet(address indexed user, uint256 endTimestamp);
    event TrialExtended(address indexed user, uint256 additionalTime);

    constructor() {
        admin = msg.sender;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can call this function");
        _;
    }

    function setAdmin(address _admin) public onlyAdmin {
        admin = _admin;
    }

    function setTrial(address user, uint256 endTimestamp) public onlyAdmin {
        trialEnds[user] = endTimestamp;
        emit TrialSet(user, endTimestamp);
    }

    function extendTrial(address user, uint256 additionalTime) public onlyAdmin {
        trialEnds[user] += additionalTime;
        emit TrialExtended(user, additionalTime);
    }

    function isTrialActive(address user) public view returns (bool) {
        return trialEnds[user] > block.timestamp;
    }
}
